import { TIMESTAMP } from './../util/timestamps';
import { Context } from '../resolvers';
import { DeleteResult } from '../../../../types/resolvers-types';
import { throwError } from '../../../../shared/errors';
import { Actions } from '../util/permission';

// eslint-disable-next-line @typescript-eslint/no-empty-function
const NOOP = () => {};

type BaseEntity = {
  createdAt: number|string;
  updatedAt: number|string;
  id: string;
};

type AuthFunction = (action: Actions, context: Context) => Promise<void>;
type BaseConstructor<DatabaseType, FetchTypes extends Record<string, any>> = {
  entity: DatabaseType & { id: string };
  context?: Context;
  getters: Getters<FetchTypes>;
  update?: (updatedEntity: DatabaseType) => Promise<DatabaseType>;
  remove?: (id: string) => Promise<DeleteResult>;
  authorize?: AuthFunction;
  name: string;
  from: string;
};

type Getters<FetchTypes extends Record<string, any>> = Record<keyof FetchTypes, () => Promise<FetchTypes[keyof FetchTypes]>>;

type MatchedMap<T extends Record<string, any>> = Map<keyof T, T[keyof T]>;

export class Base<DatabaseType extends BaseEntity, GraphQLType extends BaseEntity, FetchTypes extends Record<string, any> = Record<string, unknown>> {
  private data: DatabaseType;
  private getters: Getters<FetchTypes>;
  private cache: MatchedMap<FetchTypes>;
  private setMap: Map<keyof DatabaseType, DatabaseType[keyof DatabaseType]>;
  private updateFunc?: (updatedEntity: DatabaseType) => Promise<DatabaseType>;
  private deleteFunc?: (id: string) => Promise<DeleteResult>;
  private resolved: boolean;

  authFunc: AuthFunction | (() => void);
  from: string;
  context: Context;

  id: string;
  name: string;

  constructor({ entity, context, getters, update, remove, name, from, authorize }: BaseConstructor<DatabaseType, FetchTypes>) {
    if (!entity) {
      throwError(`CollabServer.${name}`, `[${name}] Entity not found. ${from}`);
    }
    if(Array.isArray(entity)) {
      throwError(`CollabServer.${name}`, `[${name}] Entity is an array, resolver must return a [${name}] entity. ${from}`)
    }
    if (!entity.id) {
      throwError(`CollabServer.${name}`, `[${name}] Entity must have an ID. ${from}`);
    }
    this.getters = getters;
    this.cache = new Map();
    this.data = entity;
    this.updateFunc = update;
    this.setMap = new Map();
    this.deleteFunc = remove;
    this.authFunc = authorize || NOOP;
    this.id = entity.id;
    this.from = from;
    this.context = context;
    this.name = name;
    this.resolved = false;
  }

  getFromCache<T extends keyof FetchTypes>(key: T): FetchTypes[T] | null {
    return this.cache.get(key) as FetchTypes[T];
  }

  getEntity(): DatabaseType {
    return { ...this.data };
  }

  getAuthFunction() {
    return this.authFunc;
  }

  async get<T extends keyof DatabaseType>(key: T): Promise<DatabaseType[T]> {
    /**
     * Check permissions
     */
    return this.data[key as string];
  }

  async set(key: keyof DatabaseType, value: DatabaseType[keyof DatabaseType]) {
    this.setMap.set(key, value);
  }

  async delete(useAuth?: boolean) {
    const id = this.id;
    try{
      if (useAuth) await this.authFunc(Actions.DELETE, this.context);
      return await this.deleteFunc(id);
    } catch(e) {
      return {
        id,
        successful: false
      }
    }

  }

  async setMultiple(obj: Partial<Record<keyof DatabaseType, DatabaseType[keyof DatabaseType]>>) {
    for (const key in obj) {
      const value = obj[key];
      await this.set(key, value);
    }
  }

  setCalculated(key: keyof FetchTypes, value: FetchTypes[keyof FetchTypes]) {
    this.cache.set(key, value);
  }

  async save(useAuth?: boolean) {
    //check permission to edit
    if (useAuth) await this.authFunc(Actions.EDIT, this.context);
    if (!this.updateFunc) {
      throwError(`CollabServer.${this.name}.save()`, `Cannot update ${this.name} entity, 'update' function not provided`);
    }
    const entity = this.getEntity();

    this.setMap.forEach((value, key) => {
      entity[key as string] = value;
    });

    entity.updatedAt = TIMESTAMP;

    const result = await this.updateFunc(entity);
    this.data = {
      ...entity,
      ...(result || {})
    }
    return entity;
  }

  /**
   * Returns the whole object including all fetched properties
   */
  async resolve({ asEntity = false, } = {}): Promise<DatabaseType & FetchTypes> {
    const base = this.getEntity();
    const { requestedFields } = this.context;
    let getters;
    if(!requestedFields) {
      getters = [];
    } else {
      getters = Object.keys(this.getters)
      .filter(key => Object.keys(requestedFields).includes(key));
    }
    if (this.resolved) {
      return (base as unknown) as DatabaseType & FetchTypes;
    }
    this.resolved = true;

    for (const key of getters) {
      if (this.cache.has(key)) {
        base[key] = this.cache.get(key);
      } else {
        const getter = this.getters[key];
        const result = await getter();
        this.cache.set(key, result);
        base[key] = result;
      }
    }
    if (asEntity) {
      for (const key in base) {
        if (getters.includes(key)) {
          const value = base[key];
          if (!value) continue;
          if (typeof value === 'number' || typeof value === 'string' || typeof value === 'boolean') continue;
          if (Array.isArray(value)) {
            if (value.length === 0) continue;
            const result = await Promise.all(
              value.map(async (item) => {
                return await item.resolve({ asEntity: true });
              })
            );
            // @ts-ignore
            base[key] = result;
          } else {
            // @ts-ignore
            const result = await value.resolve({ asEntity: true });
            base[key] = result
          }
        }
      }
    }
    return (base as unknown) as DatabaseType & FetchTypes;
  }

  async resolveAsEntity(useAuth?: boolean): Promise<GraphQLType> {
    //permission to read
    if (useAuth) await this.authFunc(Actions.READ, this.context); 
    return (this.resolve({ asEntity: true }) as unknown) as GraphQLType;
  }

  async getCalculated<T extends keyof FetchTypes>(key: T): Promise<FetchTypes[T]> {
    /**
     * Permission check
     */
    if (this.cache.has(key)) {
      return this.cache.get(key) as FetchTypes[T];
    }
    const result = await this.getters[key]();
    this.cache.set(key, result);
    return result as FetchTypes[T];
  }
}
